import React from 'react'
import { Text, View, StyleSheet } from 'react-native'
import FlexScreen from './FlexScreen'

const PositionScreen = () => {
  return (
    <View style={styles.viewStyle}>
      <View style={styles.textViewStyle}>
        <Text style={styles.textStyle}>App</Text>
      </View>
      <View style={styles.textOneStyle} />
      <View style={styles.textTwoStyle} />
      <View style={styles.textThreeStyle} />
    </View>
  )
}

const styles = StyleSheet.create({
  viewStyle: {
    borderWidth: 1,
    borderColor: 'black',
  },
  textViewStyle: {
    borderWidth: 2,
    borderRightColor: 'black',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  textStyle: {
    fontSize: 30,
    paddingVertical: 20,
  },
  boxOneStyle: {
    borderWidth: 1,
    borderColor: 'black',
    backgroundColor: 'red',
    height: 100,
    width: 100,
  },
  boxTwoStyle: {
    borderWidth: 1,
    borderColor: 'black',
    backgroundColor: 'green',
    height: 100,
    width: 100,
  },
  boxThreeStyle: {
    borderWidth: 1,
    borderColor: 'black',
    backgroundColor: 'blue',
    height: 100,
    width: 100,
  },
})

export default PositionScreen
